    const navigate = useNavigate();
    const HandlerReturn=()=>{
        navigate("/")
    }
    return(
        <><h1>Sesion cerrada correctamente</h1>
        <button onClick ={HandlerReturn}>Regresar al inicio</button>
        </>
        
        
    )
 }
 export default LogOut;
